import React from 'react';

export default class RenderRows extends React.Component {
    render() {
        return (
            <div>
                <h1>NCSA Lab Hours</h1>
                <table>
                    <thead>
                        <tr>
                            <th>Date</th>
                            <th>Name</th>
                            <th>Add/Remove Item</th>
                        </tr>
                    </thead>
                    <tbody></tbody>
                </table>
            </div>
        );
    }
}
